An unbounded 
<a href="BlockingQueue.html" title="interface in java.util.concurrent">blocking queue</a> that uses the same ordering rules as class 
<a href="../PriorityQueue.html" title="class in java.util"><code>PriorityQueue</code></a> and supplies blocking retrieval operations. While this queue is logically unbounded, attempted additions may fail due to resource exhaustion (causing 
<code>OutOfMemoryError</code>). This class does not permit 
<code>null</code> elements. A priority queue relying on 
<a href="../../lang/Comparable.html" title="interface in java.lang">natural ordering</a> also does not permit insertion of non-comparable objects (doing so results in 
<code>ClassCastException</code>). 
<p>This class and its iterator implement all of the <em>optional</em> methods of the <a href="../Collection.html" title="interface in java.util"><code>Collection</code></a> and <a href="../Iterator.html" title="interface in java.util"><code>Iterator</code></a> interfaces. The Iterator provided in method <a href="#iterator()"><code>iterator()</code></a> and the Spliterator provided in method <a href="#spliterator()"><code>spliterator()</code></a> are <em>not</em> guaranteed to traverse the elements of the PriorityBlockingQueue in any particular order. If you need ordered traversal, consider using <code>Arrays.sort(pq.toArray())</code>. Also, method <code>drainTo</code> can be used to <em>remove</em> some or all elements in priority order and place them in another collection. </p>
<p>Operations on this class make no guarantees about the ordering of elements with equal priority. If you need to enforce an ordering, you can define custom classes or comparators that use a secondary key to break ties in primary priority values. For example, here is a class that applies first-in-first-out tie-breaking to comparable elements. To use it, you would insert a <code>new FIFOEntry(anEntry)</code> instead of a plain entry object. </p>
<pre> <code>
 class FIFOEntry&lt;E extends Comparable&lt;? super E&gt;&gt;
     implements Comparable&lt;FIFOEntry&lt;E&gt;&gt; {
   static final AtomicLong seq = new AtomicLong(0);
   final long seqNum;
   final E entry;
   public FIFOEntry(E entry) {
     seqNum = seq.getAndIncrement();
     this.entry = entry;
   }
   public E getEntry() { return entry; }
   public int compareTo(FIFOEntry&lt;E&gt; other) {
     int res = entry.compareTo(other.entry);
     if (res == 0 &amp;&amp; other.entry != this.entry)
       res = (seqNum &lt; other.seqNum ? -1 : 1);
     return res;
   }
 }</code></pre> 
